import{_ as e,o,c as d,e as c}from"./app-3153922c.js";const a={},i=c('<h1 id="linux-查找头文件所在的依赖包" tabindex="-1"><a class="header-anchor" href="#linux-查找头文件所在的依赖包" aria-hidden="true">#</a> <code>Linux</code> 查找头文件所在的依赖包</h1><p>在 <code>Linux</code> 下编译一些软件的时候，由于你的系统没有安装相关的开发库依赖包，有时候会出现找不到某些头文件的情况。</p><p>以 <code>Xlib.h</code> 为例，我们可以通过一些工具来搜索哪些软件包包含这些头文件。</p><h2 id="redhat-系" tabindex="-1"><a class="header-anchor" href="#redhat-系" aria-hidden="true">#</a> <code>Redhat</code> 系</h2><p><code>sudo yum provides */Xlib.h</code></p><blockquote><blockquote><p>命令里的 <code>*/</code> 很关键哦，参数是大小写敏感的，不能写成 <code>*/xlib.h</code></p></blockquote></blockquote><h2 id="debian-系" tabindex="-1"><a class="header-anchor" href="#debian-系" aria-hidden="true">#</a> <code>Debian</code> 系</h2><ul><li>安装工具：<code>sudo apt install apt-file</code></li><li>更新索引：<code>sudo apt update</code> 或者 <code>sudo apt-file update</code></li><li>搜索头文件：<code>sudo apt-file search Xlib.h</code></li></ul><blockquote><blockquote><p>可以通过加 <code>-i</code> 选项来忽略大小写</p></blockquote></blockquote>',9),t=[i];function l(n,u){return o(),d("div",null,t)}const r=e(a,[["render",l],["__file","Linux查找头文件所在的依赖包.html.vue"]]);export{r as default};
